pragma solidity ^0.6.0;

import {SafeMath} from "./openzeppelin/contracts/token/ERC20/SafeERC20.sol";
import "./openzeppelin/contracts/access/Ownable.sol";
import "../interfaces/IStrategy.sol";

contract Settings is Ownable {
    using SafeMath for uint256;


    // Dev wallet
    address public Fees;

    address public immutable controller;


    uint256 public SLIPPAGE_POINTS;
    uint256 public SLIPPAGE_BASE_POINTS;


    address[] public routers;
    mapping(address => bool) internal _Routers;

    address[] public vaults;
    mapping(address => uint8) internal _vaults;
    mapping(address => uint256) internal _vaultId;

    mapping(address => IStrategy) internal _tokenStrategies;
    mapping(address => uint256) internal _minimumDeposit;


    constructor(
        address _feeAddress,
        address _controller,
        uint256 _slippagePoints,
        uint256 _slippageBasePoints,
        address[] memory _routers
    ) public {
        Fees = _feeAddress;
        controller = _controller;
        _setSlippage(_slippagePoints, _slippageBasePoints);
        for(uint i = 0; i < _routers.length; i++) {
            _addRouter(_routers[i]);
        }
    }

    /* --------------------------------------------------------------- */

    function vault(address _vault) public view returns (bool) {
        return _vaults[_vault] == 1 ? true : false;
    }


    function vaultId(address _vault) public view returns (uint256) {
        return _vaultId[_vault];
    }


    function strategy(address _token) public view returns (IStrategy) {
        return _tokenStrategies[_token];
    }


    function slippage(uint256 _amountIn) public view returns (uint256) {
        return _amountIn.sub(_amountIn.mul(SLIPPAGE_POINTS).div(SLIPPAGE_BASE_POINTS));
    }


    function minimumDeposit(address _token) public view returns (uint256) {
        return _minimumDeposit[_token];
    }


    function router(address _router) public view returns (bool) {
        return _Routers[_router];
    }


    function vaultsLength() public view returns (uint256) {
        return vaults.length;
    }


    function routersLength() public view returns (uint256) {
        return routers.length;
    }

    /* --------------------------------------------------------------- */


    function deactivateRouter(address _router) public onlyOwner {
        require(_Routers[_router]);
        _Routers[_router] = false;
    }


    function setFeeAddress(address _feeAddress) public onlyOwner {
        require(Fees != _feeAddress, "CornFi Settings: Not a New Fee Address");
        Fees = _feeAddress;
    }


    function setSlippage(uint256 _slippagePoints, uint256 _slippageBasePoints) public onlyOwner {
        _setSlippage(_slippagePoints, _slippageBasePoints);
    }


    function addVault(address _vault) public onlyOwner {
        require(_vaults[_vault] == 0);
        _vaultId[_vault] = vaults.length;
        vaults.push(_vault);
        _vaults[_vault] = 1;
    }


    function deactivateVault(address _vault) public onlyOwner {
        _vaults[_vault] = 2;
    }


    function setStrategy(address _token, IStrategy _strategy, uint256 _minDeposit) public onlyOwner {
        require(address(_tokenStrategies[_token]) == address(0));
        _tokenStrategies[_token] = _strategy;
        _minimumDeposit[_token] = _minDeposit;
    }


    function changeMinimumDeposit(address _token, uint256 _minDeposit) public onlyOwner {
        require(address(_tokenStrategies[_token]) != address(0));
        _minimumDeposit[_token] = _minDeposit;
    }

    /* --------------------------------------------------------------- */

    function _setSlippage(uint256 _slippagePoints, uint256 _slippageBasePoints) internal {
        SLIPPAGE_POINTS = _slippagePoints;
        SLIPPAGE_BASE_POINTS = _slippageBasePoints;
    }


    function _addRouter(address _router) internal {
        require(!_Routers[_router]);
        routers.push(_router);
        _Routers[_router] = true;
    }
}
